import {AbsQscApi} from "./abstract/AbsQscApi";
import {SbootQscApi} from "./sboot/SbootQscApi";
import {DubboQscApi} from "./dubbo/DubboQscApi";
class QscApi extends AbsQscApi{
  api = null;
    constructor(module) {
        super(module);
        //1.初始化api
        if (this.moduletype == "sboot") {
            this.api = new SbootQscApi(module);
        } else if (this.moduletype == "dubbo") {
            this.api = new DubboQscApi(module);
        }
    }
  search(pagingRequest) {
    return this.api.search(pagingRequest)
  }

  getQueryObjcet(id) {
    return this.api.getQueryObjcet(id)
  }
}

export {QscApi}